import React from "react";
import style from "./alertBuilder.module.css"

function AlertBuilder(alertText) {
  return (
    <div className={style.alertSection}>
      <div>{alertText}</div>
      <button>확인</button>
    </div>
  );
}

export default AlertBuilder;
